import * as React from 'react';
import styled from '@mui/system/styled';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import HomeIcon from '@mui/icons-material/Home';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MoreIcon from '@mui/icons-material/MoreVert';

const StyledAppBar = styled(AppBar)({
  top: 'auto',
  bottom: 0,
  background: 'transparent',
  boxShadow: 'none',
  borderTop: '1px solid #ccc',
  position: 'fixed',
  width: '100%',
  overflow: 'visible',
  height: '80px', // Ajusta la altura de la barra de aplicación según sea necesario
});

const CenteredBox = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'flex-start', // Alinea los elementos en la parte superior de la barra
  width: '100%',
  padding: '0 16px',
});

const PartiallyVisibleIconButton = styled(IconButton)({
  borderRadius: '50%',
  backgroundColor: '#ecf3f3',
  '&:hover': {
    backgroundColor: '#b0c4c4',
  },
  position: 'relative',
  zIndex: 1,
});



export default function BottomAppBar() {
  return (
    <StyledAppBar>
      <Toolbar>
        <CenteredBox>
          <IconButton size="large" edge="start" color="#ecf3f3" aria-label="open drawer">
            <MoreIcon />
          </IconButton>
          <IconButton size="large" edge="start" color="#ecf3f3" aria-label="open drawer"  style={{ marginLeft: '5px', marginTop: '-35px' }}>
            <HomeIcon />
          </IconButton>
          <IconButton size="large" edge="end" color="#ecf3f3" aria-label="account">
            <AccountCircleIcon />
          </IconButton>
        </CenteredBox>
      </Toolbar>
    </StyledAppBar>
  );
}
